import React from 'react';
import moment from 'moment';
import * as timeManipulations from '../api/api';

export default class TimeTesting extends React.Component {


    render() {
        console.log(moment(Date.now()).format("MMM-DD-YYYY hh:mm:ss"))
        let dayOfWeekSubtractor = moment(Date.now()).day()-1;
        let dayOfWeekAdder = 7-dayOfWeekSubtractor;
        let lowerPlaceholder = moment(Date.now()).subtract(dayOfWeekSubtractor, 'days');
        let upperPlaceholder = moment(Date.now()).add(dayOfWeekAdder, 'days');
        console.log(lowerPlaceholder.format("MMM-DD-YYYY hh:mm:ss"));
        console.log(upperPlaceholder.format("MMM-DD-YYYY hh:mm:ss"));
        let lowerBoundry = moment().set({
            'year': lowerPlaceholder.get('year'),
            'date': lowerPlaceholder.get('date'),
            'hour':6,
            'minute':0,
            'second':0,
            'millisecond':0
        });
        let upperBoundry = moment().set({
            'year': upperPlaceholder.get('year'),
            'date': upperPlaceholder.get('date'),
            'hour':6,
            'minute':0,
            'second':0,
            'millisecond':0
        });
        console.log(lowerBoundry.format("MMM-DD-YYYY hh:mm:ss"));
        console.log(upperBoundry.format("MMM-DD-YYYY hh:mm:ss"));


        return (
            <div>
                time tester
            </div>
        );
  }
}
